	{
		#region Public Methods

		/// <summary>
		/// Checks availability of Epson devices configured on the system
		/// </summary>
		/// <returns></returns>
		public List<DeviceStatus> GetDeviceStatus()
		{
			string logPreFix = "Peripheral.Server.Impl.PeripheralServiceImpl:GetDeviceStatus()";
			WriteLog(string.Format("{0} : Begins", logPreFix));

			List<DeviceStatus> epsonDevices = new List<DeviceStatus>();

			WriteLog(string.Format("{0} - Reading configured printers in Windows", logPreFix));
			ManagementObjectSearcher searcher = new ManagementObjectSearcher("SELECT * FROM Win32_Printer WHERE Name like 'EPSON%' ");


			foreach (ManagementObject device in searcher.Get())
			{
				DeviceStatus deviceStatus = GetEpsonDeviceStatus(device, logPreFix);
				epsonDevices.Add(deviceStatus);
			}

			WriteLog(string.Format("{0} : Completed", logPreFix));

			return epsonDevices;
		}

		/// <summary>
		/// Checks Epson PDS drivers installed with version number 
		/// </summary>
		/// <returns></returns>
		public VerificationResponse PDSDriverVerification()
		{
			string logPreFix = "Peripheral.Server.Impl.PeripheralServiceImpl:PDSDriverVerification()";
			WriteLog(string.Format("{0} : Begins", logPreFix));

			VerificationResponse verificationResponse = new VerificationResponse();
			// Checks 64 bit machine
			WriteLog(string.Format("{0} - Verifying PDS driver installation", logPreFix));

			string registryPath = @"HKEY_LOCAL_MACHINE\SOFTWARE\Wow6432Node\EPSON\EPSON Printer Driver For TM-S Series";
			string registryKeyName = "InstallVersion";
			string pdsDriverVersion = Convert.ToString(Registry.GetValue(registryPath, registryKeyName, null));


			// Checks 32 bit machine
			if (string.IsNullOrWhiteSpace(pdsDriverVersion))
			{
				registryPath = registryPath.Replace(@"\Wow6432Node", "");
				pdsDriverVersion = Convert.ToString(Registry.GetValue(registryPath, registryKeyName, null));
			}


			if (!string.IsNullOrWhiteSpace(pdsDriverVersion))
			{
				WriteLog(logPreFix, pdsDriverVersion);
				verificationResponse.Name = "Epson PDS Driver";
				verificationResponse.Version = pdsDriverVersion;
			}

			WriteLog(string.Format("{0} : Completed", logPreFix));
			return verificationResponse;
		}

		/// <summary>
		/// Checks Epson SDK drivers installed with version number
		/// </summary>
		/// <returns></returns>
		public VerificationResponse SDKDriverVerification()
		{
			string logPreFix = "Peripheral.Server.Impl.PeripheralServiceImpl:SDKDriverVerification()";
			WriteLog(string.Format("{0} : Begins", logPreFix));

			VerificationResponse verificationResponse = new VerificationResponse();
			// checks 64 bit machine

			WriteLog(string.Format("{0} - Verifying SDK driver installation", logPreFix));
			string driverNameRegistryPath = @"HKEY_LOCAL_MACHINE\SOFTWARE\Wow6432Node\Microsoft\Windows\CurrentVersion\Uninstall\EPSON TM-S9000 Driver";
			string driverVersionRegistryPath = @"HKEY_LOCAL_MACHINE\SOFTWARE\Wow6432Node\Microsoft\Windows\CurrentVersion\Uninstall\EPSON TM-S9000 Driver";

			string sdkDriverName = (string)Registry.GetValue(driverNameRegistryPath, "DisplayName", null);
			string sdkDriverVersion = (string)Registry.GetValue(driverVersionRegistryPath, "DisplayVersion", null);

			// checks 32 bit machine
			if (string.IsNullOrWhiteSpace(sdkDriverName))
			{
				driverNameRegistryPath = driverNameRegistryPath.Replace(@"\Wow6432Node", "");
				driverVersionRegistryPath = driverVersionRegistryPath.Replace(@"\Wow6432Node", "");

				sdkDriverName = (string)Registry.GetValue(driverNameRegistryPath, "DisplayName", null);
				sdkDriverVersion = (string)Registry.GetValue(driverVersionRegistryPath, "DisplayVersion", null);
			}

			if (!string.IsNullOrWhiteSpace(sdkDriverName))
			{
				WriteLog(logPreFix, sdkDriverName);
				WriteLog(logPreFix, sdkDriverVersion);

				verificationResponse.Name = sdkDriverName;
				verificationResponse.Version = sdkDriverVersion;
			}

			WriteLog(string.Format("{0} : Completed", logPreFix));

			return verificationResponse;
		}

		/// <summary>
		/// Verifies all required dependency files and folders are available in installation folder
		/// </summary>
		/// <returns></returns>
		public FileVerificationResponse PSFileVerification()
		{
			string logPreFix = "Peripheral.Server.Impl.PeripheralServiceImpl:PSFileVerification()";
			WriteLog(string.Format("{0} : Begins", logPreFix));

			string currentryDirectoryPath = AppDomain.CurrentDomain.BaseDirectory.TrimEnd('\\');

			string[] files = new string[]
			{
				"BuildInfo.txt",
				"DocX.dll",
				"EpsonBankDriver.dll",
				"Spring.Aop.dll",
				"Spring.Core.dll",
				"Newtonsoft.Json.dll",
				"reset.log",
                "ps-zeo.tcfbank.com.pfx",
				"version.txt", 
				"redirect.txt"
			};

			string[] folders = new string[]
 			{
				"OpenOffice",
				"Temp"
			};

			var peripheralFiles = new List<PSFile>();

			foreach (var folder in folders)
			{
				string folderPath = string.Format("{0}\\{1}", currentryDirectoryPath, folder);
				peripheralFiles.Add(new PSFile()
				{
					Name = folder,
					Type = "Directory",
					Exists = Directory.Exists(folderPath)
				});
				WriteLog(string.Format("The {0} is {1}", folderPath, Directory.Exists(folderPath) ? "found" : "not found"));

			}

			foreach (var file in files)
			{
				string filePath = string.Format("{0}\\{1}", currentryDirectoryPath, file);
				peripheralFiles.Add(new PSFile()
				{
					Name = file,
					Type = "File",
					Exists = File.Exists(filePath)
				});
				WriteLog(string.Format("The {0} is {1}", filePath, File.Exists(filePath) ? "found" : "not found"));
			}

			var response = new FileVerificationResponse()
			{
				FileStatus = peripheralFiles,
				Path = currentryDirectoryPath
			};

			WriteLog(string.Format("{0} : Completed", logPreFix));

			return response;
		}

