		#region Private Methods

		/// <summary>
		/// 
		/// </summary>
		/// <param name="device"></param>
		/// <param name="logPreFix"></param>
		/// <returns></returns>
		private DeviceStatus GetEpsonDeviceStatus(ManagementObject device, string logPreFix)
		{
			DeviceStatus deviceStatus = new DeviceStatus();
			string printerName = device["Name"].ToString();
			WriteLog(logPreFix, printerName);
			WriteLog(string.Format("{0} - Device {1} found", logPreFix, printerName));

			bool printerAvailable = false;

			if (device["PrinterStatus"].ToString() == "0" || device["PrinterStatus"].ToString() == "1" || device["PrinterStatus"].ToString() == "3" || device["PrinterStatus"].ToString() == "4")
			{
				printerAvailable = device["DetectedErrorState"].ToString() == "0";
			}

			deviceStatus = new DeviceStatus
			{
				DeviceName = printerName,
				Status = printerAvailable ? "Online" : "Offline"
			};

			WriteLog(string.Format("{0} - Device {1} is {2}", logPreFix, printerName, printerAvailable ? "Online" : "Offline"));

			return deviceStatus;
		}

		/// <summary>
		/// Reads receipt print template from installation directory
		/// </summary>
		/// <returns></returns>
		private string ReadTemplate(string logPreFix)
		{

			WriteLog(string.Format("{0} - Reading receipt template file name", logPreFix));
			string fileName = ConfigurationManager.AppSettings["ReceiptPrintTemplate"];
			WriteLog(logPreFix, fileName);

			WriteLog(string.Format("{0} - Reading execution directory name", logPreFix));
			string currentryDirectoryPath = AppDomain.CurrentDomain.BaseDirectory.TrimEnd('\\');
			WriteLog(currentryDirectoryPath);

			WriteLog(string.Format("{0} - Generating complete file path of receipt template", logPreFix));
			string filePath = string.Format("{0}\\{1}", currentryDirectoryPath, fileName);
			WriteLog(logPreFix, filePath);

			byte[] fileContent = File.ReadAllBytes(filePath);
			string base64file = Convert.ToBase64String(fileContent);
			WriteLog(string.Format("{0} - Convertion to base64 string success", logPreFix));

			return base64file;
		}

		/// <summary>
		/// Wrapper method for Trace.WriteLine
		/// </summary>
		/// <param name="prefix"></param>
		private void WriteLog(string prefix)
		{
			Trace.WriteLine(prefix, DateTime.Now.ToString());
		}

		/// <summary>
		/// Wrapper method for Trace.WriteLineIf
		/// </summary>
		/// <param name="prefix"></param>
		/// <param name="data"></param>
		private void WriteLog(string prefix, string data)
		{
			Trace.WriteLineIf(!string.IsNullOrWhiteSpace(data), string.Format("{0} - {1}", prefix, data), DateTime.Now.ToString());
		}

		/// <summary>
		/// Splits 
		/// </summary>
		/// <param name="message"></param>
		/// <returns></returns>
		private IEnumerable<string> MessageBlockSplit(string message)
		{
			var length = 2000;
			for (int i = 0; i < message.Length; i += length)
			{
				yield return message.Substring(i, Math.Min((message.Length - i), Math.Min(length, message.Length)));
			}
		}

		#endregion		
